import React, { useEffect, useState } from 'react';
import './Table.scss';
import TableItem from './TableItem';
import axios from 'axios';

function Table({ week }: { week: number }) {
  const userList = [
    'eunlin',
    'hyeonho28',
    'no13song',
    'davinci2003',
    'kkomul1',
    'gwonllna',
    'tjfzjarlatlgus',
    'always216',
    'mjhee2647',
    'lumicode',
    'theolee72',
    'jungyun01',
  ];
  // const problemList = [
  //   1309, 9278, 16132, 1735, 23048, 15897, 30194, 23041, 2673, 3012,
  // ];
  const [data, setData] = useState<Data>({ index: -10, data: [] });
  const [init, setInit] = useState(true);
  const [problemList, setProblemList] = useState<Problem[]>([]);

  useEffect(() => {
    if (init === true) {
      setProblemList([
        { id: 13171, tier: '', isChallenge: false },
        { id: 1890, tier: '', isChallenge: false },
        5582,
        11985,
        3673,
        27435,
        26142,
        15554,
        18443,
        25490,
      ]);
      setInit(false);
    }
  }, [init]);

  useEffect(() => {
    if (problemList.length > 0) setData({ index: 0, data: [] });
  }, [problemList]);

  useEffect(() => {
    console.log(data);
    if (data.index >= 0 && data.index < userList.length) {
      const ele = userList[data.index];
      console.log(ele);
      try {
        axios
          .get('http://localhost:5000/submit/' + week + '/' + ele)
          .then((res) => {
            const row = problemList.map((ele) => {
              const filtered: Submit[] = res.data.filter((element: Submit) => {
                return Number(element.problemID) === ele;
              });
              if (
                filtered.filter((element: Submit) => {
                  return element['submitResult'] === 'ac';
                }).length > 0
              ) {
                return 'ac';
              } else {
                if (filtered.length === 0) return '';
                return filtered[0]['submitResult'];
              }
            });
            // console.log(row);
            setData((d: Data) => {
              return {
                index: d.index + 1,
                data: [...d.data, { handle: ele, submitResult: row }],
              };
            });
          })
          .catch((err) => {
            console.log(err);
            setData((d: Data) => {
              return {
                index: d.index + 1,
                data: [...d.data, { handle: ele, submitResult: [] }],
              };
            });
          });
      } catch (e) {
        console.log(e);
        setData((d: Data) => {
          return {
            index: d.index + 1,
            data: [...d.data, { handle: ele, submitResult: [] }],
          };
        });
      }
    }
  }, [data]);

  return (
    <section className="ftco-section">
      <div className="container">
        <div className="row">
          <div className="col-md-12">
            <div className="table-wrap">
              <table className="table table-responsive-xl">
                <thead>
                  <tr>
                    <th>Username</th>
                    {problemList ? (
                      problemList.map((ele) => {
                        return <th>{ele}</th>;
                      })
                    ) : (
                      <></>
                    )}
                    <th className="table-space left">&nbsp;</th>
                    <th className="table-space">&nbsp;</th>
                    <th className="table-tax">누진세</th>
                  </tr>
                </thead>
                <tbody>
                  {data.data.map((ele) => {
                    return (
                      <TableItem
                        handle={ele['handle']}
                        submitResult={ele['submitResult']}
                      />
                    );
                  })}
                </tbody>
              </table>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
}

export default Table;
